        "}\n",
        "\n",
        "image, _ = test_dataset[1]\n",
        "image_tensor = image.unsqueeze(0).to(device)\n",
        "\n",
        "with torch.no_grad():\n",
        "    prediction = model(image_tensor)[0]\n",
